import React from 'react';

const Pagination = ({ currentPage, totalPages, onPageChange }) => {
    const pageNumbers = [];

    for (let i = 1; i <= totalPages; i++) {
        pageNumbers.push(i);
    }

    return (
        <div>
            {pageNumbers.map(number => (
                <button
                    key={number}
                    onClick={() => onPageChange(number)}
                    style={{
                        margin: '0 5px',
                        padding: '5px 10px',
                        backgroundColor: number === currentPage ? '#3563E9' : 'white',
                        color: number === currentPage ? 'white' : '#3563E9',
                        border: '1px solid #3563E9',
                        borderRadius: '5px',
                        cursor: 'pointer'
                    }}
                >
                    {number}
                </button>
            ))}
        </div>
    );
};

export default Pagination;
